import { StyleSheet } from "react-native";

const style = StyleSheet.create({
    container: {
        borderWidth: 1,
        borderRadius: 5,
        margin: 10,
        padding: 10,
        justifyContent: 'center',
        backgroundColor: '#F7F9F9'
    },
    title: {
        fontSize: 22,
        color: '#0E6655',
        fontWeight: 1
    },
    label: {
        color: '#0E6655'
    },
    form: {
        padding:10
    },
    textInput: {
        borderWidth: 1,
        borderRadius: 5,
        padding: 5
    },
    button: {
        borderWidth: 1,
        borderRadius: 5,
        marginTop: 10,
        padding: 5,
        textAlign:'center',
        backgroundColor: '#52BE80',
        color: 'white'
    },
    genderButton: {
      color: "blue",
      borderWidth: 1,
      borderRadius: 5,
      marginTop: 10,
      padding: 5,
    }
});

export default {style};
